import React from 'react';
import logo from './logo.svg';
import './App.css';

function SearchBar() {
  return (
    <input className="search"></input>
  )
}

function App() {
  return (
    <div className="App">
      <nav className="App-nav">
        <div>Git Scrape</div>
        <div>View on Github</div>
      </nav>
      <div className="content">
        <SearchBar />
      </div>
    </div>
  );
}

export default App;
